import './NavBar.css';

function NavBar() {

    return (
        <div id="navbar">
            <div id="navbar-title">
                Place Holder for NavBar
            </div>
            <nav id="navbar-tab-container">
                Settings
            </nav>
        </div>
    );
}

export default NavBar;
